import Dish from './components/Dish';
import Order from './components/Order';
import Payment from './components/Payment';


let baseUrl = process.env.REACT_APP_BASEURL

class App extends Component {
  constructor(){
    super()
    this.state = {
      username: '',
      password: '',
      email: '',
      phone_num: '',
      address: '',
      payment_info: {},
      userLoggedIn: false,
      modalOpen: false,
      orders: [],
      orderToBeEdited: {},
      dishes: [],
    }
  }

  getDishes = () => {
    console.log('hit getDishes')
    console.log(baseUrl)
    fetch(baseUrl + '/dishes', {
      // credentials: 'include'
    })
    .then (res => {
      if(res.status === 200) {
        console.log('游보 fetch index dishes successful! 游보')
        return res.json()
      } else {
        console.log('fetch index dishes failed...游눢')
      }
    })
  } 

  render(){

    return (
      <div className="App">
      <Logo />
      <Nav />

      <div className="bottom-container">
        <Menu />
        <Order />
      </div>
      {/* <LoginRegister /> */}
      {/* <Dish /> */}
      {/* <Payment /> */}
    </div>
    );
  }
}

export default App;
